Hilary Duff stars in this great film about a teen age girl who is very upset about her brother&amp;#039;s death in a car crash. Terri (Hilary Duff) has a love of singing and making up her own songs. Her brother (before his death) secretly submits a DVD of her singing to a musical contest down in L.A. Her father doesn&amp;#039;t want her to go, but secretly her mom lets her go and everything goes fine, except she has stage fright. She gets through her stage fright with the help of her new friend Jay. At the end of the contest everyone at the musical school have to perform something. And if they win, they win a scholarship along with it. Her dad finds out, comes down to L.A. and makes her go home! Will he let her stay? and will she win the contest? Viewers are on the edges of their seats to find out what happens...
